      "longname": "MutationStack",
      "name": "MutationStack",
      "tags": "MutationStack",
      "summary": "",
      "description": "The following class and its utility methods allows safer and more direct modification of the mutation stack, which is stored on a token's actor. This mutation stack stores the information needed to revert the changes made by a mutation. This could be used, for example, to deal with rollover damage where the hit point value being reverted to is lower than when the mutation was first applied. Searching and querying a given mutation is a quick, read-only process. When the mutation stack is modified via one of its class methods, the actor's mutation data at that point in time will be copied for fast, local updates. No changes will be made to the actor's serialized data until the changes have been commited (MutationStack#commit). The MutationStack object will then be locked back into a read-only state sourced with this newly updated data.",
